import React from 'react';
import { Card, Carousel } from 'antd';

const { Meta } = Card;

interface AppProps {
  cardWidth?: number;
  cardHeight?: number;
}

const contentStyle: React.CSSProperties = {
  height: '450px',
  color: '#fff',
  lineHeight: '340px', 
  textAlign: 'center',
  background: '#364d79',
};

const App: React.FC<AppProps> = ({ cardWidth = 440, cardHeight = 100 }) => (
  <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: 'calc(100vh - 200px)' }}>
    <Card
      hoverable
      style={{ width: `${cardWidth}px`, height: `${cardHeight}px`, boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', marginTop: '50px' }}
      cover={
        <Carousel autoplay>
          <div>
            <img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
          </div>
          <div>
            <img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
          </div>
          <div>
            <img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
          </div>
          <div>
            <img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
          </div>
        </Carousel>
      }
    >
      <Meta title="Europe Street beat" description="www.instagram.com" />
    </Card>
  </div>
);

export default App;
